import React from 'react';
import './App.css';
import Signup from './Signup';
import Login from './Login';
import Search from './Search';
import Recipe from './Recipe';
import Pantry from './Pantry';
import Favorite from './Favorite';
import Restriction from './Restriction';
import Menu from './Menu';
import {Route, Switch } from 'react-router-dom';



class App extends React.Component {

  render(){
    return (
    <div className="App">
      <h1> Reverse Recipe</h1>
      <Menu/>
      <Switch>
      <Route path='/signup' render={(props)=><Signup {...props} />} />      
      <Route path='/login' render={(props)=><Login {...props}  />} />
      <Route path='/search' render={(props)=><Search {...props}  />} />
      <Route path='/recipe' render={(props)=><Recipe {...props} />} />
      <Route path='/pantry' render={(props)=><Pantry {...props} />} />
      <Route path='/favorite' render={(props)=><Favorite {...props} />}/>
      <Route path='/restrictions' render={(props)=><Restriction {...props} />} />

      </Switch>






    </div>
  )};
}

export default App;
